import React from 'react';
import './Features.css';

function Features() {
  const features = [
    { title: 'Project Posting', description: 'Easily post jobs with requirements, budget, and timelines.', icon: 'üìù' },
    { title: 'Bidding System', description: 'Freelancers can bid on projects to showcase their skills.', icon: 'üíº' },
    { title: 'Payment Processing', description: 'Secure and easy payment processing for completed projects.', icon: 'üí≥' },
    { title: 'Skill Tagging', description: 'Freelancers can tag their skills for better searchability.', icon: 'üè∑Ô∏è' }
  ];

  return (
    <section className="features">
      <h2>Platform Features</h2>
      <div className="features-grid">
        {features.map((feature, index) => (
          <div className="feature-item" key={index}>
            <div className="icon">{feature.icon}</div>
            <h3>{feature.title}</h3>
            <p>{feature.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Features;
